  false,\n\t\"url\": null,\n\t\"notes\": \"Trumpeter swans are found in various areas
  along the north coast of the Gulf of Alaska between Cape Fairweather and Point Whiteshed
  except for the Copper Delta-Bering River areas no intensive effort has been made
  until now to determine exactly where Swans occur and in what numbers. The Bureau
  of Sport Fisheries and Wildlife (BSF&W) is presently conducting a statewide survey
  to determine trumpeter swans numbers and distribution in Alaska.\",\n\t\"license_title\":
